.carousel{
    width:100%;
    overflow-x: scroll;    
    /* padding: 0px 30px; Le aumenta al 100% 30px extra por lo que provoca scroll horizontal    */        
    &__container{
        white-space: nowrap;
        margin: 70px 0px;
        /* padding-bottom: 10px; */
        padding: 10px 30px;
        &__container:hover .carousel-item{
            opacity: 0.3;
        }
        
    }

    &-item{
        background-color: turquoise;
        width: 200px;
        height: 300px;
        border-radius: 20px;
        overflow: hidden;
        margin-right: 10px;
        display: inline-block;
        cursor: pointer;
        transition: 450ms all;
        transform-origin: center left;
        position: relative;
        &:hover ~ &{
            transform: translate3d(100px,0,0);
        }
        &__img {
            width: 200px;
            height: 300px;
            object-fit: cover;
        }
        &__details{
            background: linear-gradient(to top,rgba(0,0,0,0.9) 0%,rgba(0,0,0,0) 100%);        
            font-weight: bold;
            color: white;
            opacity: 0;
            transition: 450ms opacity;
            padding: 10px;
            position: absolute;
            top: 0;
            left: 0;
            right: 0;
            bottom:0;       
            display: flex;
            flex-direction: column;
            justify-content: flex-end;
            align-items: flex-end;
            &:hover{
                opacity: 1;
            }
            &--img{
                margin: 0px;
            }
            &--title{
                font-size: 14px;
                margin: 0px;
            }
            &--subtitle{
                font-size: 12px;
                margin: 0px;
            }
        }

    }



    &::-webkit-scrollbar{
        width: 12px;
        &-track {
            -webkit-box-shadow: inset 0 0 6px rgba(0,0,0,0); 
            border-radius: 10px;
            &:hover {
                -webkit-box-shadow: inset 0 0 6px rgba(0,0,0,1); 
                border-radius: 10px;
            }
        }
        &-thumb {
            border-radius: 10px;
            -webkit-box-shadow: inset 0 0 6px rgba(0,0,0,1);        
        }
    }

}
