    display : grid;
    grid-template-columns: 1fr 1fr 1fr ;
    grid-template-rows: 1fr 1fr 1fr ;
    justify-items: center;
    &--0{
        grid-column: 1; 
        grid-row: 1;
    }
    &--1{
        grid-column: 2; 
        grid-row: 1;
    }
    &--2{
        grid-column: 3; 
        grid-row: 1;
    }
    &--3{
        grid-column: 1; 
        grid-row: 2;
    }
    &--4{
        grid-column: 3; 
        grid-row: 2;
    }
    &--5{
        grid-column: 1; 
        grid-row: 3;
    }
    &--6{
        grid-column: 2; 
        grid-row: 3;
    }
    &--7{
        grid-column: 3; 
        grid-row: 3;
    }
